/* eslint-disable react-hooks/exhaustive-deps */
import React from "react";
import "./App.scss";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import { IReqGetUsers, IUsersState } from "./Store/Users";
import { connect } from "react-redux";
import { reqGetUsers } from "Store/Users/Users.store";
import { User } from "Models/users";

interface IApp {
  reqGetUsers: ({ page, limit }: { page: number; limit: number }) => IReqGetUsers;
  users: User[];
}

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={MenuContainer} />
          <Route exact path="/coupon" component={CouponContainer} />
        </Switch>
      </Router>
    </div>
  );
}

export default connect(
  ({ Users }: { Users: IUsersState }) => ({
    users: Users.userList,
  }),
  {
    reqGetUsers,
  }
)(App);
